
import React, { useState, useRef, useEffect, useCallback, useMemo } from 'react';
import ControlPanel from './components/ControlPanel';
import BeadStatistics from './components/BeadStatistics';
import { PatternConfig, BeadColor, BeadBrand } from './types';
import { DEFAULT_CONFIG, BRAND_DISPLAY_NAMES, BRAND_PALETTES, MIN_PIXELS, MAX_PIXELS } from './constants';

// --- LOGO CONFIGURATION ---
const LOGO_URL = "data:image/png;base64,";

interface BeadData {
  x: number;
  y: number;
  hex: string;
  id: string;
  r: number;
  g: number;
  b: number;
}

type MobileTab = 'upload' | 'brand' | 'canvas' | 'materials';

const POSTERIZE_LEVELS = [0, 40, 30, 24, 18, 14, 10, 7, 5, 3, 2];

function rgb2lab(rgb: [number, number, number]): [number, number, number] {
  let r = rgb[0] / 255, g = rgb[1] / 255, b = rgb[2] / 255;
  r = (r > 0.04045) ? Math.pow((r + 0.055) / 1.055, 2.4) : r / 12.92;
  g = (g > 0.04045) ? Math.pow((g + 0.055) / 1.055, 2.4) : g / 12.92;
  b = (b > 0.04045) ? Math.pow((b + 0.055) / 1.055, 2.4) : b / 12.92;

  let x = (r * 0.4124 + g * 0.3576 + b * 0.1805) / 0.95047;
  let y = (r * 0.2126 + g * 0.7152 + b * 1.00000) / 1.00000;
  let z = (r * 0.0193 + g * 0.1192 + b * 0.9505) / 1.08883;

  x = (x > 0.008856) ? Math.pow(x, 1/3) : (7.787 * x) + 16/116;
  y = (y > 0.008856) ? Math.pow(y, 1/3) : (7.787 * y) + 16/116;
  z = (z > 0.008856) ? Math.pow(z, 1/3) : (7.787 * z) + 16/116;

  return [(116 * y) - 16, 500 * (x - y), 200 * (y - z)];
}

function deltaE(labA: [number, number, number], labB: [number, number, number]): number {
  return Math.sqrt(
    Math.pow(labA[0] - labB[0], 2) +
    Math.pow(labA[1] - labB[1], 2) +
    Math.pow(labA[2] - labB[2], 2)
  );
}

const App: React.FC = () => {
  const [config, setConfig] = useState<PatternConfig>(DEFAULT_CONFIG);
  const [originalImage, setOriginalImage] = useState<HTMLImageElement | null>(null);
  const [beadColors, setBeadColors] = useState<BeadColor[]>([]);
  const [beads, setBeads] = useState<BeadData[]>([]);
  const [patternSize, setPatternSize] = useState({ width: 0, height: 0 });
  const [mobileTab, setMobileTab] = useState<MobileTab>('upload');
  const [isPanelExpanded, setIsPanelExpanded] = useState(false);
  
  const containerRef = useRef<HTMLDivElement>(null);
  const svgRef = useRef<SVGSVGElement>(null);
  const fileInputRef = useRef<HTMLInputElement>(null);

  const [scale, setScale] = useState(0.8);
  const [offset, setOffset] = useState({ x: 0, y: 0 });
  const [isDragging, setIsDragging] = useState(false);
  const [lastMousePos, setLastMousePos] = useState({ x: 0, y: 0 });

  const pixelSize = 24;
  const paddingUnits = 2;
  const rulerUnits = 1;
  const edgeOffset = paddingUnits + rulerUnits;

  const totalBeads = useMemo(() => beadColors.reduce((acc, curr) => acc + curr.count, 0), [beadColors]);

  const loadImage = (src: string): Promise<HTMLImageElement> => {
    return new Promise((resolve, reject) => {
      const img = new Image();
      img.crossOrigin = "anonymous";
      img.onload = () => resolve(img);
      img.onerror = reject;
      img.src = src;
    });
  };

  const resetView = useCallback(() => {
    if (!containerRef.current || patternSize.width === 0) return;
    const container = containerRef.current;
    const totalW = (patternSize.width + 2 * edgeOffset) * pixelSize;
    const totalH = (patternSize.height + 2 * edgeOffset) * pixelSize;
    const paddingFactor = 0.7;
    const fitScaleW = (container.clientWidth * paddingFactor) / totalW;
    const fitScaleH = (container.clientHeight * paddingFactor) / totalH;
    const newScale = Math.min(fitScaleW, fitScaleH, 1.0);
    const centerX = (container.clientWidth - totalW * newScale) / 2;
    const centerY = (container.clientHeight - (totalH * newScale)) / 2;
    setScale(newScale);
    setOffset({ x: centerX, y: centerY });
  }, [patternSize, edgeOffset, pixelSize]);

  const handleFileUpload = (e: React.ChangeEvent<HTMLInputElement>) => {
    const file = e.target.files?.[0];
    if (!file) return;

    const reader = new FileReader();
    reader.onload = async (event) => {
      const src = event.target?.result as string;
      const img = await loadImage(src);
      setOriginalImage(img);
      if (window.innerWidth < 1024) {
        setMobileTab('canvas');
        setIsPanelExpanded(false);
      }
    };
    reader.readAsDataURL(file);
  };

  useEffect(() => {
    if (patternSize.width > 0) {
      resetView();
    }
  }, [patternSize.width, patternSize.height, resetView]);

  const processImage = useCallback(() => {
    if (!originalImage) return;

    const w = config.pixelWidth;
    const ratio = originalImage.height / originalImage.width;
    const h = Math.round(w * ratio);
    setPatternSize({ width: w, height: h });

    const tempCanvas = document.createElement('canvas');
    const tempCtx = tempCanvas.getContext('2d');
    if (!tempCtx) return;
    tempCanvas.width = w;
    tempCanvas.height = h;

    tempCtx.imageSmoothingEnabled = false;
    tempCtx.filter = `brightness(${config.brightness}%) contrast(${config.contrast}%) saturate(${config.saturation}%)`;
    tempCtx.drawImage(originalImage, 0, 0, w, h);
    const rawData = tempCtx.getImageData(0, 0, w, h).data;

    const pixels = new Float32Array(w * h * 3);
    for (let i = 0; i < w * h; i++) {
      const idx = i * 4;
      const alpha = rawData[idx + 3] / 255;
      pixels[i * 3] = rawData[idx] * alpha + 255 * (1 - alpha);
      pixels[i * 3 + 1] = rawData[idx + 1] * alpha + 255 * (1 - alpha);
      pixels[i * 3 + 2] = rawData[idx + 2] * alpha + 255 * (1 - alpha);

      if (config.posterizeLevels > 0) {
        const levels = config.posterizeLevels;
        for (let j = 0; j < 3; j++) {
          const val = pixels[i * 3 + j];
          pixels[i * 3 + j] = Math.floor(val / (256 / levels)) * (255 / (levels - 1));
        }
      }
    }

    let targetPalette = config.selectedBrand === 'Original' 
      ? [] 
      : BRAND_PALETTES[config.selectedBrand].map(p => {
          const r = parseInt(p.hex.slice(1, 3), 16);
          const g = parseInt(p.hex.slice(3, 5), 16);
          const b = parseInt(p.hex.slice(5, 7), 16);
          const lab = rgb2lab([r, g, b]);
          return { ...p, r, g, b, lab };
        });

    const findClosestInActivePalette = (r: number, g: number, b: number) => {
      if (config.selectedBrand === 'Original') {
        const hex = `#${((1 << 24) + (Math.max(0, Math.min(255, Math.round(r))) << 16) + (Math.max(0, Math.min(255, Math.round(g))) << 8) + Math.max(0, Math.min(255, Math.round(b)))).toString(16).slice(1)}`;
        return { hex, id: hex.toUpperCase(), name: 'Original Color' };
      }
      const targetLab = rgb2lab([r, g, b]);
      let closest = targetPalette[0];
      let minScore = Infinity;
      for (const p of targetPalette) {
        const diff = deltaE(targetLab, p.lab as [number, number, number]);
        if (diff < minScore) {
          minScore = diff;
          closest = p;
        }
      }
      return closest;
    };

    const finalBeads: BeadData[] = [];
    const statsMap: Record<string, BeadColor> = {};

    for (let y = 0; y < h; y++) {
      for (let x = 0; x < w; x++) {
        const pixelIdx = (y * w + x) * 3;
        const oldR = pixels[pixelIdx];
        const oldG = pixels[pixelIdx + 1];
        const oldB = pixels[pixelIdx + 2];

        const closest = findClosestInActivePalette(oldR, oldG, oldB);
        const newR = 'r' in closest ? (closest as any).r : parseInt(closest.hex.slice(1, 3), 16);
        const newG = 'g' in closest ? (closest as any).g : parseInt(closest.hex.slice(3, 5), 16);
        const newB = 'b' in closest ? (closest as any).b : parseInt(closest.hex.slice(5, 7), 16);

        finalBeads.push({ x, y, hex: closest.hex, id: closest.id, r: newR, g: newG, b: newB });

        if (config.ditheringEnabled) {
          const errR = oldR - newR;
          const errG = oldG - newG;
          const errB = oldB - newB;
          const distributeError = (nx: number, ny: number, weight: number) => {
            if (nx >= 0 && nx < w && ny >= 0 && ny < h) {
              const nIdx = (ny * w + nx) * 3;
              pixels[nIdx] += errR * weight;
              pixels[nIdx + 1] += errG * weight;
              pixels[nIdx + 2] += errB * weight;
            }
          };
          distributeError(x + 1, y, 7 / 16);
          distributeError(x - 1, y + 1, 3 / 16);
          distributeError(x, y + 1, 5 / 16);
          distributeError(x + 1, y + 1, 1 / 16);
        }

        if (!statsMap[closest.hex]) {
          statsMap[closest.hex] = { hex: closest.hex, count: 0, id: closest.id, name: closest.name, brand: config.selectedBrand };
        }
        statsMap[closest.hex].count++;
      }
    }
    setBeads(finalBeads);
    setBeadColors(Object.values(statsMap));
  }, [originalImage, config]);

  useEffect(() => {
    processImage();
  }, [processImage]);

  const renderSvgContent = useMemo(() => {
    if (beads.length === 0) return null;
    const elements = [];
    const { width: w, height: h } = patternSize;
    const gridOpacity = config.gridOpacity;
    const metricStrokeColor = "#cbd5e1"; 
    const rulerBgColor = "#f1f5f9";
    const rulerMajorBgColor = "#e2e8f0";
    const totalWidthUnits = w + 2 * edgeOffset;
    const totalHeightUnits = h + 2 * edgeOffset;

    elements.push(<rect key="doc-bg" x={0} y={0} width={totalWidthUnits * pixelSize} height={totalHeightUnits * pixelSize} fill="white" />);

    const corners = [[0, 0], [totalWidthUnits - 1, 0], [0, totalHeightUnits - 1], [totalWidthUnits - 1, totalHeightUnits - 1]];
    corners.forEach(([uX, uY], idx) => elements.push(<rect key={`corner-${idx}`} x={uX * pixelSize} y={uY * pixelSize} width={pixelSize} height={pixelSize} fill={rulerMajorBgColor} />));

    for (let i = 1; i <= w; i++) {
      const isMajor = i % 5 === 0;
      const x = (i - 1 + edgeOffset) * pixelSize;
      const textStyle = { fontSize: '9px', fontWeight: isMajor ? '900' : '700', fill: isMajor ? '#1e293b' : '#64748b' };
      const fill = isMajor ? rulerMajorBgColor : rulerBgColor;
      elements.push(<g key={`hruler-${i}`}>
        <rect x={x} y={0} width={pixelSize} height={pixelSize} fill={fill} />
        <text x={x + pixelSize/2} y={pixelSize/2} textAnchor="middle" dominantBaseline="middle" style={textStyle}>{i}</text>
        <rect x={x} y={(totalHeightUnits - 1) * pixelSize} width={pixelSize} height={pixelSize} fill={fill} />
        <text x={x + pixelSize/2} y={(totalHeightUnits - 1) * pixelSize + pixelSize/2} textAnchor="middle" dominantBaseline="middle" style={textStyle}>{i}</text>
      </g>);
    }
    for (let i = 1; i <= h; i++) {
      const isMajor = i % 5 === 0;
      const y = (i - 1 + edgeOffset) * pixelSize;
      const textStyle = { fontSize: '9px', fontWeight: isMajor ? '900' : '700', fill: isMajor ? '#1e293b' : '#64748b' };
      const fill = isMajor ? rulerMajorBgColor : rulerBgColor;
      elements.push(<g key={`vruler-${i}`}>
        <rect x={0} y={y} width={pixelSize} height={pixelSize} fill={fill} />
        <text x={pixelSize/2} y={y + pixelSize/2} textAnchor="middle" dominantBaseline="middle" style={textStyle}>{i}</text>
        <rect x={(totalWidthUnits - 1) * pixelSize} y={y} width={pixelSize} height={pixelSize} fill={fill} />
        <text x={(totalWidthUnits - 1) * pixelSize + pixelSize/2} y={y + pixelSize/2} textAnchor="middle" dominantBaseline="middle" style={textStyle}>{i}</text>
      </g>);
    }

    beads.forEach((bead, idx) => {
      const effectiveX = config.isMirrored ? (w - 1 - bead.x) : bead.x;
      const dx = (effectiveX + edgeOffset) * pixelSize;
      const dy = (bead.y + edgeOffset) * pixelSize;
      const brightness = (bead.r * 299 + bead.g * 587 + bead.b * 114) / 1000;
      const textColor = brightness > 150 ? 'rgba(0,0,0,0.6)' : 'rgba(255,255,255,0.8)';
      
      elements.push(<g key={`bead-${idx}`}>
        {config.beadShape === 'circle' ? (
          <g>
            <circle cx={dx + pixelSize/2} cy={dy + pixelSize/2} r={pixelSize/2 - 1.5} fill={bead.hex} />
            <circle cx={dx + pixelSize/2} cy={dy + pixelSize/2} r={pixelSize/6} fill="rgba(0,0,0,0.1)" />
          </g>
        ) : (
          <rect x={dx} y={dy} width={pixelSize} height={pixelSize} fill={bead.hex} />
        )}
        {config.showLabels && <text x={dx + pixelSize/2} y={dy + pixelSize/2} textAnchor="middle" dominantBaseline="middle" fill={textColor} style={{ fontSize: '7px', fontWeight: 'bold', pointerEvents: 'none' }}>{bead.id}</text>}
      </g>);
    });

    let metricPath = `M0,0 L${totalWidthUnits * pixelSize},0 L${totalWidthUnits * pixelSize},${totalHeightUnits * pixelSize} L0,${totalHeightUnits * pixelSize} Z `;
    for (let i = 0; i <= totalWidthUnits; i++) {
      const lx = i * pixelSize;
      if (i === 0 || i === totalWidthUnits) { metricPath += `M${lx},0 L${lx},${totalHeightUnits * pixelSize} `; } 
      else { metricPath += `M${lx},0 L${lx},${pixelSize} `; metricPath += `M${lx},${(totalHeightUnits - 1) * pixelSize} L${lx},${totalHeightUnits * pixelSize} `; }
    }
    for (let j = 0; j <= totalHeightUnits; j++) {
      const ly = j * pixelSize;
      if (j === 0 || j === totalHeightUnits) { metricPath += `M0,${ly} L${totalWidthUnits * pixelSize},${ly} `; } 
      else { metricPath += `M0,${ly} L${pixelSize},${ly} `; metricPath += `M${(totalWidthUnits - 1) * pixelSize},${ly} L${totalWidthUnits * pixelSize},${ly} `; }
    }
    elements.push(<path key="fixed-metric-border" d={metricPath} fill="none" stroke={metricStrokeColor} strokeWidth={1} shapeRendering="crispEdges" />);

    if (gridOpacity > 0) {
      let gridPath = "";
      const canvasStart = pixelSize;
      const canvasEndW = (totalWidthUnits - 1) * pixelSize;
      const canvasEndH = (totalHeightUnits - 1) * pixelSize;
      gridPath += `M${canvasStart},${canvasStart} L${canvasEndW},${canvasStart} L${canvasEndW},${canvasEndH} L${canvasStart},${canvasEndH} Z `;
      for (let i = 2; i < totalWidthUnits - 1; i++) { const lx = i * pixelSize; gridPath += `M${lx},${canvasStart} L${lx},${canvasEndH} `; }
      for (let j = 2; j < totalHeightUnits - 1; j++) { const ly = j * pixelSize; gridPath += `M${canvasStart},${ly} L${canvasEndW},${ly} `; }
      elements.push(<path key="unified-adjustable-grid" d={gridPath} fill="none" stroke={config.gridColor} strokeWidth={1} strokeOpacity={gridOpacity} shapeRendering="crispEdges" />);
    }
    return elements;
  }, [beads, config, patternSize, edgeOffset]);

  const handleMouseDown = (e: React.MouseEvent) => { setIsDragging(true); setLastMousePos({ x: e.clientX, y: e.clientY }); };
  const handleMouseMove = (e: React.MouseEvent) => { if (!isDragging) return; const dx = e.clientX - lastMousePos.x; const dy = e.clientY - lastMousePos.y; setOffset(prev => ({ x: prev.x + dx, y: prev.y + dy })); setLastMousePos({ x: e.clientX, y: e.clientY }); };
  const handleMouseUp = () => setIsDragging(false);
  const handleWheel = (e: React.WheelEvent) => { e.preventDefault(); const zoomSpeed = 0.001; const delta = -e.deltaY; const newScale = Math.min(Math.max(0.1, scale + delta * zoomSpeed), 5); if (containerRef.current) { const rect = containerRef.current.getBoundingClientRect(); const mouseX = e.clientX - rect.left; const mouseY = e.clientY - rect.top; const zoomRatio = newScale / scale; setOffset({ x: mouseX - (mouseX - offset.x) * zoomRatio, y: mouseY - (mouseY - offset.y) * zoomRatio }); setScale(newScale); } };

  const updateConfig = (key: keyof PatternConfig, value: any) => {
    setConfig(prev => ({ ...prev, [key]: value }));
  };

  const downloadPattern = async (dpiOverride?: 72 | 300) => {
    if (!svgRef.current) return;
    const svgElement = svgRef.current;
    const svgData = new XMLSerializer().serializeToString(svgElement);
    const svgBlob = new Blob([svgData], { type: "image/svg+xml;charset=utf-8" });
    const url = URL.createObjectURL(svgBlob);
    
    const originalWidth = (patternSize.width + 2 * edgeOffset) * pixelSize;
    const originalHeight = (patternSize.height + 2 * edgeOffset) * pixelSize;
    const targetDpi = dpiOverride || config.exportDpi;
    const scaleFactor = targetDpi / 72;
    
    // Layout Constants
    const headerHeight = 100 * scaleFactor;
    const legendPadding = 40 * scaleFactor;
    const swatchSize = 28 * scaleFactor; // Larger swatch
    const textGap = 10 * scaleFactor;
    const legendItemWidth = 140 * scaleFactor;
    const legendItemHeight = 50 * scaleFactor; // More vertical space
    const contentWidth = originalWidth * scaleFactor;
    const itemsPerRow = Math.max(1, Math.floor((contentWidth - (40 * scaleFactor)) / legendItemWidth));
    
    const sortedColors = [...beadColors].sort((a, b) => b.count - a.count);
    const numRows = Math.ceil(sortedColors.length / itemsPerRow);
    const legendHeight = (numRows * legendItemHeight) + (legendPadding * 2) + (30 * scaleFactor); 
    
    const canvas = document.createElement("canvas");
    canvas.width = contentWidth; 
    canvas.height = headerHeight + (originalHeight * scaleFactor) + legendHeight;
    const ctx = canvas.getContext("2d");
    if (!ctx) return;

    // Load images
    const logoImg = new Image();
    const mainImg = new Image();
    
    const loadImg = (img: HTMLImageElement, src: string) => new Promise((resolve) => {
      img.onload = resolve;
      img.src = src;
    });

    await Promise.all([
      loadImg(logoImg, LOGO_URL),
      loadImg(mainImg, url)
    ]);

    // Background
    ctx.fillStyle = "#ffffff"; 
    ctx.fillRect(0, 0, canvas.width, canvas.height);

    // --- Header Rendering ---
    const logoSize = 60 * scaleFactor;
    const margin = 30 * scaleFactor;
    
    // Draw Logo
    ctx.drawImage(logoImg, margin, (headerHeight - logoSize) / 2, logoSize, logoSize);
    
    // Brand Name
    ctx.fillStyle = "#1e293b";
    ctx.font = `900 ${32 * scaleFactor}px 'Dosis', sans-serif`;
    ctx.textBaseline = "middle";
    ctx.textAlign = "left";
    ctx.fillText("BIG DOU", margin + logoSize + 15 * scaleFactor, headerHeight / 2 - 8 * scaleFactor);
    
    // Subtitle
    ctx.fillStyle = "#64748b";
    ctx.font = `bold ${14 * scaleFactor}px sans-serif`;
    ctx.fillText(" (Perler Pattern Generator)", margin + logoSize + 15 * scaleFactor, headerHeight / 2 + 15 * scaleFactor);
    
    // Meta Info (Right aligned)
    ctx.textAlign = "right";
    ctx.fillStyle = "#94a3b8";
    ctx.font = `bold ${12 * scaleFactor}px sans-serif`;
    ctx.fillText(`: ${config.beadSize} | : ${config.pixelWidth}x${patternSize.height} | DPI: ${targetDpi}`, canvas.width - margin, headerHeight / 2);
    
    // Separator Line
    ctx.strokeStyle = "#e2e8f0";
    ctx.lineWidth = 2 * scaleFactor;
    ctx.beginPath();
    ctx.moveTo(margin, headerHeight);
    ctx.lineTo(canvas.width - margin, headerHeight);
    ctx.stroke();

    // --- Main Pattern ---
    ctx.imageSmoothingEnabled = false; 
    ctx.drawImage(mainImg, 0, headerHeight, originalWidth * scaleFactor, originalHeight * scaleFactor);

    // --- Material List ---
    const legendYStart = headerHeight + (originalHeight * scaleFactor) + legendPadding;
    
    // Legend Title
    ctx.textAlign = "left";
    ctx.fillStyle = "#334155";
    ctx.font = `900 ${20 * scaleFactor}px sans-serif`;
    ctx.fillText(" (Material List)", margin, legendYStart);
    
    const gridStartY = legendYStart + (40 * scaleFactor);
    
    sortedColors.forEach((color, index) => {
      const col = index % itemsPerRow;
      const row = Math.floor(index / itemsPerRow);
      
      const x = margin + (col * legendItemWidth);
      const y = gridStartY + (row * legendItemHeight);
      
      // 1. Color Swatch
      ctx.fillStyle = color.hex;
      
      if ((ctx as any).roundRect) {
        ctx.beginPath();
        (ctx as any).roundRect(x, y, swatchSize, swatchSize, 6 * scaleFactor);
        ctx.fill();
      } else {
        ctx.fillRect(x, y, swatchSize, swatchSize);
      }
      
      // Swatch Border (for light colors)
      ctx.strokeStyle = "rgba(0,0,0,0.08)";
      ctx.lineWidth = 1 * scaleFactor;
      if ((ctx as any).roundRect) {
        ctx.beginPath();
        (ctx as any).roundRect(x, y, swatchSize, swatchSize, 6 * scaleFactor);
        ctx.stroke();
      } else {
        ctx.strokeRect(x, y, swatchSize, swatchSize);
      }
      
      // 2. Text Info
      const textX = x + swatchSize + textGap;
      const swatchCenterY = y + (swatchSize / 2);
      
      // Color ID
      ctx.fillStyle = "#0f172a"; // Darker slate
      ctx.font = `bold ${14 * scaleFactor}px sans-serif`;
      ctx.textBaseline = "bottom";
      ctx.fillText(color.id, textX, swatchCenterY - (2 * scaleFactor));
      
      // Count
      ctx.fillStyle = "#64748b"; // Muted slate
      ctx.font = `bold ${12 * scaleFactor}px sans-serif`;
      ctx.textBaseline = "top";
      ctx.fillText(`${color.count} `, textX, swatchCenterY + (2 * scaleFactor));
    });

    // Copyright Footer (Optional but nice)
    ctx.textAlign = "center";
    ctx.fillStyle = "#cbd5e1";
    ctx.font = `${10 * scaleFactor}px sans-serif`;
    ctx.textBaseline = "bottom";
    ctx.fillText("Generated by BIG DOU", canvas.width / 2, canvas.height - (10 * scaleFactor));

    // Finalize
    const pngUrl = canvas.toDataURL("image/png");
    const downloadLink = document.createElement("a");
    downloadLink.href = pngUrl; 
    downloadLink.download = `bigdou-pattern-${targetDpi}dpi-${Date.now()}.png`;
    downloadLink.click(); 
    URL.revokeObjectURL(url);
  };

  const baseBtnClass = "py-3 px-3 text-xs font-bold rounded-xl border transition-all flex-1 text-center shadow-sm active:scale-95";
  const activeBtnClass = "bg-indigo-50 text-indigo-600 border-indigo-200";
  const inactiveBtnClass = "bg-white text-slate-500 border-slate-200 hover:border-slate-300";

  const currentPosterizeIndex = POSTERIZE_LEVELS.indexOf(config.posterizeLevels);
  const colorMergeValue = currentPosterizeIndex === -1 ? 0 : currentPosterizeIndex;

  const handleMobilePosterizeChange = (val: number) => {
     const safeIndex = Math.max(0, Math.min(POSTERIZE_LEVELS.length - 1, val));
     updateConfig('posterizeLevels', POSTERIZE_LEVELS[safeIndex]);
  };

  return (
    <div className="flex flex-col h-screen bg-pegboard overflow-hidden text-slate-900 select-none font-sans">
      <header className="h-16 lg:h-20 bg-white border-b border-slate-200 px-4 lg:px-8 flex items-center justify-between shrink-0 z-50 shadow-sm">
        <div className="flex items-center gap-3">
          <img src={LOGO_URL} alt="Brand Logo" className="w-8 h-8 lg:w-10 lg:h-10 rounded-lg shadow-indigo-200 shadow-lg object-cover" />
          <div className="flex flex-col">
            <h1 className="text-xl lg:text-2xl font-black text-slate-800 tracking-tight font-logo leading-none">BIG DOU</h1>
            <span className="text-[10px] font-bold text-slate-400 uppercase tracking-widest mt-0.5"></span>
          </div>
        </div>
        <div className="hidden lg:flex items-center gap-4">
           <a href="#" className="text-xs font-bold text-slate-500 hover:text-indigo-600 transition-colors"></a>
           <a href="#" className="text-xs font-bold text-slate-500 hover:text-indigo-600 transition-colors"></a>
           <button className="px-4 py-2 bg-slate-900 text-white rounded-lg text-xs font-bold hover:bg-slate-800 transition-colors">
             Pro 
           </button>
        </div>
      </header>

      <main className="flex-1 flex overflow-hidden relative">
        <aside className="hidden lg:flex w-80 h-full bg-white/95 backdrop-blur border-r border-slate-200 overflow-y-auto shrink-0 shadow-xl shadow-slate-200/50 z-20">
          <ControlPanel 
            config={config} 
            onChange={setConfig} 
            onFileUpload={handleFileUpload} 
            onImageGenerated={() => {}} 
            onDownload={() => downloadPattern()} 
            originalImageSrc={originalImage?.src} 
            beadColors={beadColors}
          />
        </aside>

        <div ref={containerRef} className="flex-1 relative overflow-hidden cursor-crosshair bg-slate-50/50" 
             onMouseDown={handleMouseDown} onMouseMove={handleMouseMove} onMouseUp={handleMouseUp} onMouseLeave={handleMouseUp} onWheel={handleWheel}>
          
          <div className="absolute top-6 left-1/2 -translate-x-1/2 z-20 flex items-center justify-center">
            <div className="bg-white/90 backdrop-blur rounded-2xl shadow-lg shadow-slate-200/50 border border-slate-200 p-1.5 flex items-center gap-1">
               <button onClick={() => setScale(prev => Math.max(0.1, prev - 0.1))} className="w-9 h-9 flex items-center justify-center text-slate-500 hover:text-indigo-600 hover:bg-indigo-50 rounded-xl transition-all" title="">
                 <svg className="w-5 h-5" fill="none" stroke="currentColor" viewBox="0 0 24 24"><path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2.5" d="M20 12H4" /></svg>
               </button>
               <div className="w-12 text-center">
                 <span className="text-xs font-black text-slate-700 tabular-nums">{Math.round(scale * 100)}%</span>
               </div>
               <button onClick={() => setScale(prev => Math.min(5, prev + 0.1))} className="w-9 h-9 flex items-center justify-center text-slate-500 hover:text-indigo-600 hover:bg-indigo-50 rounded-xl transition-all" title="">
                 <svg className="w-5 h-5" fill="none" stroke="currentColor" viewBox="0 0 24 24"><path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2.5" d="M12 4v16m8-8H4" /></svg>
               </button>
               <div className="w-px h-5 bg-slate-200 mx-1"></div>
               <button onClick={resetView} className="px-3 py-1.5 text-slate-500 hover:text-indigo-600 hover:bg-indigo-50 rounded-xl transition-all flex items-center gap-1.5" title="">
                 <svg className="w-4 h-4" fill="none" stroke="currentColor" viewBox="0 0 24 24"><path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2.5" d="M4 8V4m0 0h4M4 4l5 5m11-1V4m0 0h-4m4 0l-5 5M4 16v4m0 0h4m-4 0l5-5m11 5l-5-5m5 5v-4m0 4h-4" /></svg>
               </button>
            </div>
          </div>

          {!originalImage ? (
            <div className="absolute inset-0 flex flex-col items-center justify-center text-center p-8">
              <div 
                onClick={() => fileInputRef.current?.click()}
                className="group relative cursor-pointer flex flex-col items-center"
              >
                <div className="relative w-48 h-48 mb-8 transition-transform duration-300 group-hover:-translate-y-2">
                   <img src={LOGO_URL} alt="Start Creating" className="w-full h-full rounded-3xl shadow-xl shadow-indigo-200 object-cover border-4 border-white/50" />
                   <div className="absolute -bottom-6 -right-6 w-20 h-20 bg-white rounded-full flex items-center justify-center text-indigo-600 shadow-2xl shadow-indigo-100 group-hover:scale-110 transition-transform border-[6px] border-slate-50">
                      <svg className="w-10 h-10" fill="none" stroke="currentColor" viewBox="0 0 24 24"><path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2.5" d="M12 4v16m8-8H4" /></svg>
                   </div>
                </div>
              </div>
              
              <h2 className="text-xl font-black text-slate-800 mb-3 tracking-tight"></h2>
              <p className="text-slate-400 max-w-xs mx-auto mb-10 font-medium text-sm leading-relaxed">
                BIGDOU
              </p>
            </div>
          ) : (
            <div style={{ position: 'absolute', left: offset.x, top: offset.y, transform: `scale(${scale})`, transformOrigin: '0 0' }}>
              <div className="shadow-2xl shadow-slate-400/20 rounded-[4px] overflow-hidden bg-white ring-1 ring-slate-900/5">
                <svg ref={svgRef} width={(patternSize.width + 2 * edgeOffset) * pixelSize} height={(patternSize.height + 2 * edgeOffset) * pixelSize} className="pointer-events-none">
                    {renderSvgContent}
                </svg>
              </div>
            </div>
          )}
        </div>

        <aside className="hidden lg:block w-80 h-full bg-white/95 backdrop-blur border-l border-slate-200 overflow-y-auto shrink-0 shadow-xl shadow-slate-200/50 z-20">
          <BeadStatistics colors={beadColors} selectedSize={config.beadSize} onDownload={downloadPattern} />
        </aside>

        <div className="lg:hidden absolute bottom-0 left-0 right-0 z-40 flex flex-col pointer-events-none">
           <div className={`pointer-events-auto bg-white border-t border-slate-200 rounded-t-3xl shadow-[0_-8px_30px_rgba(0,0,0,0.12)] relative transition-transform duration-300 ease-out ${isPanelExpanded ? 'translate-y-0' : 'translate-y-[calc(100%-72px)]'}`}>
             
             <div 
               onClick={() => setIsPanelExpanded(!isPanelExpanded)}
               className="flex items-center justify-center px-6 pt-3 pb-3 cursor-pointer"
             >
                <div className="w-12 h-1.5 bg-slate-200 rounded-full mb-1"></div>
             </div>
             
             <div 
                className={`absolute top-6 left-0 right-0 px-6 flex items-center justify-between transition-opacity duration-200 ${isPanelExpanded ? 'opacity-0 pointer-events-none' : 'opacity-100'}`}
                onClick={() => setIsPanelExpanded(true)}
             >
                <div>
                   <span className="text-xs font-bold text-slate-400 block mb-0.5"></span>
                   <div className="flex items-center gap-3">
                     <div className="flex items-center gap-1.5">
                       <span className="text-lg font-black text-slate-800">{totalBeads}</span>
                       <span className="text-xs font-bold text-slate-400"></span>
                     </div>
                     <div className="w-px h-3 bg-slate-200"></div>
                     <div className="flex items-center gap-1.5">
                       <span className="text-lg font-black text-slate-800">{beadColors.length}</span>
                       <span className="text-xs font-bold text-slate-400"></span>
                     </div>
                   </div>
                </div>
                <button className="bg-indigo-600 text-white p-3 rounded-full shadow-lg shadow-indigo-200">
                   <svg className="w-5 h-5" fill="none" stroke="currentColor" viewBox="0 0 24 24"><path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2.5" d="M5 15l7-7 7 7" /></svg>
                </button>
             </div>

             <div className={`px-6 pb-24 pt-2 transition-all duration-300 ${isPanelExpanded ? 'opacity-100 max-h-[500px]' : 'opacity-0 max-h-0 pointer-events-none'}`}>
               <div className="overflow-y-auto max-h-[420px] custom-scrollbar -mr-2 pr-2">
                 {mobileTab === 'upload' && (
                   <div className="space-y-4 py-2">
                     <input type="file" ref={fileInputRef} accept="image/*" onChange={handleFileUpload} className="hidden" />
                     <div onClick={() => fileInputRef.current?.click()} className={`h-40 rounded-2xl border-2 border-dashed flex flex-col items-center justify-center transition-all ${originalImage ? 'border-indigo-200 bg-indigo-50/20' : 'border-slate-200 bg-slate-50'}`}>
                        {originalImage ? (
                          <div className="flex flex-col items-center gap-3">
                            <img src={originalImage.src} className="w-24 h-24 rounded-xl object-cover border-2 border-white shadow-sm" alt="Preview" />
                            <span className="text-xs font-bold text-indigo-600 bg-white px-3 py-1 rounded-lg shadow-sm"></span>
                          </div>
                        ) : (
                          <div className="flex flex-col items-center gap-3">
                             <div className="p-3 bg-white rounded-xl shadow-sm text-indigo-500">
                               <svg className="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24"><path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2.5" d="M12 4v16m8-8H4" /></svg>
                             </div>
                             <span className="text-xs font-bold text-slate-500"></span>
                          </div>
                        )}
                     </div>
                   </div>
                 )}
                 
                 {mobileTab === 'brand' && (
                   <div className="space-y-6 py-2">
                     <div className="space-y-3">
                        <label className="text-xs font-bold text-slate-500 uppercase"></label>
                        <select value={config.selectedBrand} onChange={(e) => updateConfig('selectedBrand', e.target.value as BeadBrand)} className="w-full bg-slate-50 border border-slate-200 rounded-xl py-4 px-4 text-sm font-bold text-slate-700 outline-none focus:border-indigo-500">
                          {(['Original', 'Mard', 'Coco', 'Manman', 'Panpan', 'Mixiaowo'] as BeadBrand[]).map(b => <option key={b} value={b}>{BRAND_DISPLAY_NAMES[b]}</option>)}
                        </select>
                     </div>
                     <div className="grid grid-cols-2 gap-4">
                        <button onClick={() => updateConfig('showLabels', !config.showLabels)} className={`${baseBtnClass} h-14 ${config.showLabels ? activeBtnClass : inactiveBtnClass}`}></button>
                        <button onClick={() => updateConfig('ditheringEnabled', !config.ditheringEnabled)} className={`${baseBtnClass} h-14 ${config.ditheringEnabled ? activeBtnClass : inactiveBtnClass}`}></button>
                     </div>
                   </div>
                 )}

                 {mobileTab === 'canvas' && (
                   <div className="space-y-8 py-2">
                     <div className="space-y-4">
                        <div className="flex justify-between items-center">
                           <span className="text-xs font-bold text-slate-500 uppercase"></span>
                           <span className="text-xs font-black text-indigo-600 bg-indigo-50 px-2 py-1 rounded-md">{config.pixelWidth} px</span>
                        </div>
                        <div className="flex items-center gap-4">
                           <button onClick={() => updateConfig('pixelWidth', Math.max(MIN_PIXELS, config.pixelWidth - 1))} className="w-12 h-12 bg-white rounded-xl border border-slate-200 text-indigo-600 active:scale-95 transition-all font-black text-xl flex items-center justify-center shadow-sm hover:border-indigo-300">-</button>
                           <input type="range" min={MIN_PIXELS} max={MAX_PIXELS} value={config.pixelWidth} onChange={(e) => updateConfig('pixelWidth', parseInt(e.target.value))} className="flex-1 h-3 bg-slate-100 rounded-full appearance-none accent-indigo-600 cursor-pointer" />
                           <button onClick={() => updateConfig('pixelWidth', Math.min(MAX_PIXELS, config.pixelWidth + 1))} className="w-12 h-12 bg-white rounded-xl border border-slate-200 text-indigo-600 active:scale-95 transition-all font-black text-xl flex items-center justify-center shadow-sm hover:border-indigo-300">+</button>
                        </div>
                     </div>

                     <div className="space-y-4">
                        <div className="flex justify-between items-center">
                           <span className="text-xs font-bold text-slate-500 uppercase"></span>
                           <span className="text-xs font-black text-indigo-600 bg-indigo-50 px-2 py-1 rounded-md">{Math.round(config.gridOpacity * 100)}%</span>
                        </div>
                        <div className="flex items-center gap-4">
                           <button onClick={() => updateConfig('gridOpacity', Math.max(0, parseFloat((config.gridOpacity - 0.05).toFixed(2))))} className="w-12 h-12 bg-white rounded-xl border border-slate-200 text-indigo-600 active:scale-95 transition-all font-black text-xl flex items-center justify-center shadow-sm hover:border-indigo-300">-</button>
                           <input type="range" min={0} max={1} step={0.05} value={config.gridOpacity} onChange={(e) => updateConfig('gridOpacity', parseFloat(e.target.value))} className="flex-1 h-3 bg-slate-100 rounded-full appearance-none accent-indigo-600 cursor-pointer" />
                           <button onClick={() => updateConfig('gridOpacity', Math.min(1, parseFloat((config.gridOpacity + 0.05).toFixed(2))))} className="w-12 h-12 bg-white rounded-xl border border-slate-200 text-indigo-600 active:scale-95 transition-all font-black text-xl flex items-center justify-center shadow-sm hover:border-indigo-300">+</button>
                        </div>
                     </div>

                     <div className="space-y-4">
                        <div className="flex justify-between items-center">
                           <span className="text-xs font-bold text-slate-500 uppercase"></span>
                           <span className="text-xs font-black text-indigo-600 bg-indigo-50 px-2 py-1 rounded-md">Lv. {colorMergeValue}</span>
                        </div>
                        <div className="flex items-center gap-4">
                           <button onClick={() => handleMobilePosterizeChange(colorMergeValue - 1)} className="w-12 h-12 bg-white rounded-xl border border-slate-200 text-indigo-600 active:scale-95 transition-all font-black text-xl flex items-center justify-center shadow-sm hover:border-indigo-300">-</button>
                           <input type="range" min={0} max={POSTERIZE_LEVELS.length - 1} step={1} value={colorMergeValue} onChange={(e) => handleMobilePosterizeChange(parseInt(e.target.value))} className="flex-1 h-3 bg-slate-100 rounded-full appearance-none accent-indigo-600 cursor-pointer" />
                           <button onClick={() => handleMobilePosterizeChange(colorMergeValue + 1)} className="w-12 h-12 bg-white rounded-xl border border-slate-200 text-indigo-600 active:scale-95 transition-all font-black text-xl flex items-center justify-center shadow-sm hover:border-indigo-300">+</button>
                        </div>
                     </div>

                     <div className="flex flex-col gap-3">
                        <span className="text-xs font-bold text-slate-500 uppercase"></span>
                        <div className="flex gap-2 p-1 bg-slate-100 rounded-xl">
                           <button onClick={() => updateConfig('beadShape', 'square')} className={`flex-1 py-3 text-xs font-bold rounded-lg transition-all ${config.beadShape === 'square' ? 'bg-white text-indigo-600 shadow-sm' : 'text-slate-400'}`}></button>
                           <button onClick={() => updateConfig('beadShape', 'circle')} className={`flex-1 py-3 text-xs font-bold rounded-lg transition-all ${config.beadShape === 'circle' ? 'bg-white text-indigo-600 shadow-sm' : 'text-slate-400'}`}></button>
                        </div>
                     </div>
                   </div>
                 )}

                 {mobileTab === 'materials' && (
                   <div className="h-[400px]">
                     <BeadStatistics colors={beadColors} onDownload={downloadPattern} />
                   </div>
                 )}
               </div>
             </div>
           </div>

           <nav className="pointer-events-auto h-[72px] bg-white/95 backdrop-blur border-t border-slate-200 flex items-center justify-around px-2 pb-safe z-50">
             {[
               { id: 'upload', icon: <svg className="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24"><path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M4 16v1a3 3 0 003 3h10a3 3 0 003-3v-1m-4-4l-4 4m0 0l-4-4m4 4V4" /></svg>, label: '' },
               { id: 'brand', icon: <svg className="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24"><path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M7 7h.01M7 3h5c.512 0 1.024.195 1.414.586l7 7a2 2 0 010 2.828l-7 7a2 2 0 01-2.828 0l-7-7A1.994 1.994 0 013 12V7a4 4 0 014-4z" /></svg>, label: '' },
               { id: 'canvas', icon: <svg className="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24"><path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M12 6V4m0 2a2 2 0 100 4m0-4a2 2 0 110 4m-6 8a2 2 0 100-4m0 4a2 2 0 110-4m0 4v2m0-6V4m6 6v10m6-2a2 2 0 100-4m0 4a2 2 0 110-4m0 4v2m0-6V4" /></svg>, label: '' },
               { id: 'materials', icon: <svg className="w-6 h-6" fill="none" stroke="currentColor" viewBox="0 0 24 24"><path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M9 17v-2m3 2v-4m3 4v-6m2 10H7a2 2 0 01-2-2V5a2 2 0 012-2h5.586a1 1 0 01.707.293l5.414 5.414a1 1 0 01.293.707V19a2 2 0 01-2 2z" /></svg>, label: '' }
             ].map(tab => (
               <button 
                 key={tab.id} 
                 onClick={() => { setMobileTab(tab.id as MobileTab); setIsPanelExpanded(true); }} 
                 className={`flex flex-col items-center gap-1 flex-1 py-1 transition-colors ${mobileTab === tab.id ? 'text-indigo-600' : 'text-slate-400'}`}
               >
                 <div className={`p-1.5 rounded-xl transition-all duration-300 ${mobileTab === tab.id ? 'bg-indigo-50 -translate-y-1' : ''}`}>
                   {tab.icon}
                 </div>
                 <span className="text-[10px] font-bold tracking-tight">{tab.label}</span>
               </button>
             ))}
           </nav>
        </div>
      </main>

      <style dangerouslySetInnerHTML={{ __html: `
        .custom-scrollbar::-webkit-scrollbar {
          width: 6px;
        }
        .custom-scrollbar::-webkit-scrollbar-thumb {
          background: #e2e8f0;
          border-radius: 99px;
        }
        .custom-scrollbar::-webkit-scrollbar-thumb:hover {
          background: #cbd5e1;
        }
        .pb-safe {
          padding-bottom: env(safe-area-inset-bottom, 20px);
        }
      `}} />
    </div>
  );
};

export default App;
